import React from 'react'
import firebase from '../utils/firebase'
import '../App2.css'

function Data({data}) {
    return (
        <div className="stu">
            <p>{data.name}</p>
            <p>{data.class}</p>
            <p>{data.number}</p>
        </div>
    )
}

export default Data;
